// React
import React, { Component, Fragment } from "react";

// Third part
import { Layout } from "antd";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

// Custom
import "../../assets/css/EmployeeForm.css";
import { Order, Reservation, Information } from "./components/";

import Footer from "../common/footer";
import EmployeeMenu from "../common/employeeMenuLink";

const { Content } = Layout;

export default class EmployeeBoard extends Component {
  render() {
    return (
      <Fragment>
        <Router>
          <Layout>
            <EmployeeMenu />
            <Content style={{ padding: "0 50px", marginTop: 94 }}>
              <Switch>
                <Route />
                <Route path="/order" component={Order} />
                <Route path="/reservation" component={Reservation} />
                <Route path="/info" component={Information} />
              </Switch>
            </Content>
            <Footer />
          </Layout>
        </Router>
      </Fragment>
    );
  }
}
